function Pizza(props) {
  return (
    <div className="pizzas">
      <div className="pizza">
        {" "}
        <img src={props.photoName} alt="pizza" />
        <h1>{props.name}</h1>
        <p>{props.ingredients}</p>
      </div>
    </div>
  );
}

export default Pizza;
